import React from "react";
import {Navbar,Footer} from "../navfoot/navbar";
import { Link } from "react-router-dom";
const Home=()=>
{
    return(
        <>
       <div className="home">
       <Navbar/>
        <div>
            <div>
            <Link to='/admin'>Admin</Link>
            <Link to='/user'>User</Link>
            </div>
        </div>
        <Footer/>
       </div>
        </>
    )
}
export default Home;
